import React, { useState, useEffect } from 'react';
import Modal from 'react-modal';

const USERS_DATA = [
  { id: 1, user: 'user1', age: 25 },
  { id: 2, user: 'user2', age: 30 },
  // Dodaj więcej użytkowników według potrzeb
];

function SzukajUzytkownika() {

  const [data, setData] = useState([]); 

  useEffect(() => {
    setData(USERS_DATA);
  }, []); 

  return (
    <>
      <div className="vh80 divWithScroll">
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Age</th>
              <th>OPT</th>
            </tr>
          </thead>
          <tbody>
            {data.map((person, index) => (
              <tr key={index}>
                <td>{person.id}</td>
                <td>{person.user}</td>
                <td>{person.age}</td>

                <td>
                  <button>Edytuj</button>
                  <button value={person.id}>Usuń</button>
                  <button>Zablokuj</button>
                  <select>
                    <option>Dodaj karte</option>
                    <option>RFID</option>
                  </select>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </>
  );
};

export default SzukajUzytkownika;
